根据用户的进一步反馈，本次提交对监视器（Watcher）的架构进行了优化，旨在将**单次检查逻辑**与**周期性调度逻辑**进行解耦，以提供更灵活、更清晰的 API。

核心变更如下：

1.  **引入 `runOnce()` 公开方法**：
    *   `BaseWatcher` 现在提供一个 `public async runOnce()` 方法。此方法封装了完整的单次检查流程：加载状态 -> 从远程获取数据 -> 检测变更 -> 执行回调 -> 持久化新状态。

2.  **`start()` 方法职责单一化**：
    *   `start()` 方法的职责被简化，现在它只负责启动和管理一个 `setInterval` 定时器，该定时器会周期性地调用 `runOnce()`。它不再包含任何核心业务逻辑。

3.  **工厂函数返回实例**：
    *   `watchIssues` 和 `watchPullRequest` 这两个工厂函数现在直接返回 `IssueWatcher` 和 `PullRequestWatcher` 的实例，而不是一个通用的句柄或自动启动的监视器。

### 使用示例

这一改变使得用户可以更灵活地使用监视器：

```typescript
// 创建一个监视器实例 (不会自动开始)
const issueWatcher = watchIssues(client, repoUrl, options);

// 按需手动触发一次检查
await issueWatcher.runOnce();

// 或者，启动后台的周期性监视
issueWatcher.start();

// ...在需要时停止
issueWatcher.stop();
```

此次重构完全采纳了用户的设计建议，显著提升了代码库的质量和可用性。

